import React, { Component } from "react";

class ListEmployees extends Component {
  render() {
    return (
      <div>
        <Menu.Item>
          <Link to={{ pathname: "/home" }}>
            {" "}
            <img
              src="https://rsrit.com/wp-content/uploads/2017/12/logo_dark.png"
              width="200px"
              height="60px"
            />
          </Link>
        </Menu.Item>
      </div>
    );
  }
}
export default ListEmployees;
